import React, { Component } from 'react'

export default class Item extends Component {
  render() {
    return (
        <li>
            <label>
                <input type="checkbox"/>
                <span>xxxxx</span>
            </label>
            <button className="btn btn-danger" style={{display:'none'}}>Delete</button>
        </li>
    )
  }
}
